    function getInternetExplorerVersion() {
		var IEIndex = navigator.appVersion.indexOf("MSIE");         // MSIE를 찾고 인덱스를 리턴
		var IE8Over = navigator.userAgent.indexOf("Trident");      // MS IE 8이상 버전 체크

		 var strVer = -1;
		if ( /MSIE 6.*Trident/.test( navigator.userAgent ) == true ) return 6;
		else if(  /MSIE 7.*Trident/.test( navigator.userAgent ) == true ) return  7;
		else if(  /MSIE 8.*Trident/.test( navigator.userAgent ) == true ) return  8;
		else if(  /MSIE 9.*Trident/.test( navigator.userAgent ) == true ) return  9;
		else if(  /MSIE 10.*Trident/.test( navigator.userAgent ) == true ) return  10;
		
 
		  if( IEIndex > 0 || IE8Over > 0 )  {
		   var trident = navigator.userAgent.match(/Trident\/(\d.\d)/i);
		   if (trident != null){
			switch (trident[1]) {
			 case "7.0" :
			  strVer = 11;
			  break;
			 case "6.0" :
			  strVer = 10;
			  break;
			 case "5.0" :
			  strVer = 9;
			  break;      
			 case "4.0" :
			  strVer = 8;
			  break;
			 default :
			  break;
			}
		   }    
		   
		   
		  }  else  {   
		   
		  }


	  return strVer;
	} 
	
