	function getDataParser(postData) 
	{
		var s1 = postData.substring(0, postData.length).split('&'), r = {}, s2, i;
		for (var i = 0; i < s1.length; i += 1) {
			s2 = s1[i].split('=');
			r[decodeURIComponent(s2[0])] = decodeURIComponent(s2[1]);
		}
		return r;
	}
	
	function getPwdElt(fieldelt)
	{
		var catchFieldKeys = Object.keys(catchFields);
		for(var i=0; i<catchFieldKeys.length;i++)
		{
			if( fieldelt == catchFields[catchFieldKeys[i]].idField)
				return catchFields[catchFieldKeys[i]].pwdField;
			
		}
		return null;
	}
	
