	function getClosestDisplay(el, tag) {

		// this is necessary since nodeName is always in upper case
		tag = tag.toUpperCase();
			do {
				if (el.nodeName === tag) {
				// tag name is found! let's return it. :)
					if ( el.style.display == "block" )
					{
						return el;
					} 
				} 
		} while (el = el.parentNode);

		// not found 
		return null;
	}
	
